import React, { useState } from "react";
import axios from "axios";
import "./index.css";

const App = () => {
  const [formData, setFormData] = useState({});
  const [prediction, setPrediction] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: parseFloat(e.target.value) || 0 });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);

    try {
      const response = await axios.post("http://127.0.0.1:8000/predict_named", formData);
      setPrediction(response.data.prediction);
    } catch (err) {
      setError("Error fetching prediction. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="container">
      <h1>F&O Prediction</h1>
      <form onSubmit={handleSubmit}>
        {[
          "Close", "High", "Low", "Open", "Volume", "SMA_5", "SMA_10", "RSI_14", "MACD", "MACD_Signal",
          "EMA_9", "EMA_21", "EMA_50", "EMA_200", "BB_upper", "BB_middle", "BB_lower", "MACD_Hist",
          "STOCH_K", "STOCH_D", "ATR", "ROC_10", "OBV", "VWAP", "ADX", "CCI", "WILLR_14", "MOM_10",
          "CMF", "PSAR", "Aroon_Up", "Aroon_Down", "Return"
        ].map((feature) => (
          <div key={feature}>
            <label>{feature}</label>
            <input type="number" name={feature} onChange={handleChange} required />
          </div>
        ))}
        <button type="submit" disabled={loading}>{loading ? "Predicting..." : "Predict"}</button>
      </form>
      {prediction !== null && <h2>Prediction: {prediction}</h2>}
      {error && <p className="error">{error}</p>}
    </div>
  );
};

export default App;
